import HomePage from "./Pages/Home/HomePage";

function App() {
  return (
    <div className="font">
      <BrowserRouter>
        <Routes>
          <Route path=""  />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
<HomePage />
